import { useState } from "react";
import UserName from "./UserName";

const Hello = function ({ age }) {
  const [name, setName] = useState("Mike");
  const msg = age > 19 ? "성인입니다." : "미성년자입니다.";

  return (
    <div>
      <h2>
        {name}({age}) : {msg}
      </h2>
      <UserName />
      <button
        onClick={() => {
          setName(name === "Mike" ? "Jane" : "Mike");
        }}
      >
        Change name
      </button>
    </div>
  );
};

export default Hello;
